/*Table structure for table `payment_transactions` */

CREATE TABLE `payment_transactions` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `order_id` bigint unsigned NOT NULL,
  `merchant_ref` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `payment_channel` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` decimal(15,2) NOT NULL,
  `fee_merchant` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT 'Fee charged to merchant',
  `fee_customer` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT 'Fee charged to customer',
  `total_fee` decimal(15,2) DEFAULT '0.00' COMMENT 'Total biaya transaksi termasuk biaya layanan dan pajak',
  `customer_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `customer_email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `customer_phone` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_items` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `callback_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `return_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `checkout_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'URL untuk melanjutkan ke proses pembayaran',
  `expired_time` bigint unsigned NOT NULL,
  `signature` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending',
  `amount_received` decimal(10,2) NOT NULL,
  `payment_response` text COLLATE utf8mb4_unicode_ci,
  `qris_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'QRIS URL for payment transactions',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `payment_transactions_order_id_foreign` (`order_id`),
  CONSTRAINT `payment_transactions_order_id_foreign` FOREIGN KEY (`order_id`) REFERENCES `orders` (`id`) ON DELETE CASCADE,
  CONSTRAINT `payment_transactions_chk_1` CHECK (json_valid(`order_items`))
